script: |
  super -f text -I q11899.spq | sort > q11899.out

inputs:
  - name: q11899.spq
    data: |
      SELECT DISTINCT + + col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( 40 * - + col1 * + 16 / + + col0 ) NOT BETWEEN col2 + - - 5 AND - col0;
  - name: tab1

outputs:
  - name: q11899.out
    data: |
      51
      85
      91
